import React from 'react';
import { NavLink } from 'react-router-dom';

          const Navbar = () => {
            return (
              <nav>
                <ul>
                  <li>
                    <NavLink to="/">Test</NavLink>
                  </li>
                  <li>
                    <NavLink to="/contact">Test</NavLink>
                  </li>
                </ul>
              </nav>
            );
          };

          Navbar.propTypes = {};

          export default Navbar;
